import './App.css'
import {useState} from 'react'
function App() {
  const [count, setCount] = useState(0);
  const addCount=()=>{
    setCount(count+1);
  }
  return (
    <>
    <button onClick={addCount}>ADD</button>
    <h1>Counter : {count}</h1>
    </>
    )
}

export default App;
